  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of a LiDAR data
  collection over the community of Unalakleet, in the Norton Sound region of Alaska.
  The original data were collected on October 27, 2005 by AeroMetric, Inc., under
  contract by Rodney P. Kinney and Associates, Inc. The complete, classified LiDAR
  dataset was purchased by the State of Alaska Division of Geological & Geophysical
  Surveys in 2013 in support of coastal vulnerability mapping efforts. For the purposes
  of open access to LiDAR datasets in coastal regions of Alaska, this collection is
  being released as a Raw Data File with an open end-user license. A copy of this
  data was supplied to the NOAA Office for Coastal Management for incorporation into
  the NOAA Digital Coast. The classifications of data available from the NOAA Digital
  Coast are: 1 (Unclassified), 2 (Ground), 3 (Low Vegetation), 4 (Medium Vegetation),
  5 (High Vegetation), 6 (Buildings), 9 (Water), 10 (Ignored Ground, breakline proximity).\",\n\t\"license_title\":
